import { useState } from "react";
import { AgregarDatos } from "./Api";
const AppInsertarDatos = () =>{
  const [personaDatos, setPersonaDatos] = useState(null);

  const savePersona = () =>{
    AgregarDatos(personaDatos);
  }
    
  return(
        <div className="container">
          <h2>Agregar usuarios</h2>
          <form>
            <label>Nombre</label>
            <input type="text" onChange={e=> setPersonaDatos(e.target.value)}/>
            <button onClick={savePersona}>Agregar nuevo usuario</button>
          </form>
        </div>
  )
}

export default AppInsertarDatos;
